import React from 'react';
import BottomNavigation from 'material-ui'


function Footer(props) {
<BottomNavigation
  value={value}
  onChange={(event, newValue) => {
    setValue(newValue);
  }}
  showLabels
  className={classes.root}
>
  <BottomNavigationAction label="Eeylops Owl Emporium" icon={<RestoreIcon />} />
  <BottomNavigationAction label="Ollivanders" icon={<FavoriteIcon />} />
  <BottomNavigationAction label="Flourish and Blotts " icon={<LocationOnIcon />} />
</BottomNavigation>
};

export default Footer;
